void ghost_ai() {
    for (int i = 0; i < 4; i++) {
        if (ghosts[i].jail) {
            continue;
        }

        // Check if ghost is close enough to the player
        int distance = abs(ghosts[i].x - player1.x) + abs(ghosts[i].y - player1.y);
        
        // Check avaible positions to move in
        int num_available_moves = 0;
        int available_moves[4][2];

        // Regular path - keep moving in the same direction
        if(ghost_path[ghosts[i].x + ghosts[i].y * MAP_WIDTH] == 0xf861 || ghost_path[ghosts[i].x + ghosts[i].y * MAP_WIDTH] == 0xf881) {
            continue;
        }

        if(ghost_path[ghosts[i].x + ghosts[i].y * MAP_WIDTH] == 0x005c){
            if(ghosts[i].dx != -1){
                available_moves[num_available_moves][0] = 1;
                available_moves[num_available_moves][1] = 0;
                num_available_moves++;
            }

            if(ghosts[i].dx != 1){
                available_moves[num_available_moves][0] = -1;
                available_moves[num_available_moves][1] = 0;
                num_available_moves++;
            }
        } 
        else {

            // At Edges - can either go left or right, decide
            if(ghost_path[ghosts[i].x + ghosts[i].y * MAP_WIDTH] == 0x0061){
                available_moves[num_available_moves][0] = 1;
                available_moves[num_available_moves][1] = 0;

                num_available_moves ++ ;
                available_moves[num_available_moves][0] = -1;
                available_moves[num_available_moves][1] = 0;
                num_available_moves ++;
            } 

            else {

                // Turn point - finish path if we're far away
                if (distance > 80 && ghost_path[ghosts[i].x + ghosts[i].y * MAP_WIDTH] == 0xfec1) {
                    if(ghosts[i].dx  != 0) {
                        available_moves[0][0] = 0;

                        if(ghost_path[ghosts[i].x + (ghosts[i].y + 1) * MAP_WIDTH] != 0xffff) {
                            available_moves[0][1] = 1;
                        }
                        else {
                            available_moves[0][1] = -1;
                        }

                        num_available_moves = 1;
                    }
                    else {
                        available_moves[0][1] = 0;

                        if(ghost_path[ghosts[i].x + 1 + ghosts[i].y * MAP_WIDTH] != 0xffff) {
                            available_moves[0][0] = 1;
                        }
                        else {
                            available_moves[0][0] = -1;
                        }

                        num_available_moves = 1;
                    }
                }

                // Thses are for if we're close enough to the player, move in the avaible direction
                else {
                    if(ghost_path[ghosts[i].x + 1 + ghosts[i].y * MAP_WIDTH] != 0xffff && ghosts[i].dx != -1) {
                        available_moves[num_available_moves][0] = 1;
                        available_moves[num_available_moves][1] = 0;
                        num_available_moves++;
                    }

                    if(ghost_path[ghosts[i].x - 1 + ghosts[i].y * MAP_WIDTH] != 0xffff && ghosts[i].dx != 1) {
                        available_moves[num_available_moves][0] = -1;
                        available_moves[num_available_moves][1] = 0;
                        num_available_moves++;
                    }
                    
                    if(ghost_path[ghosts[i].x + (ghosts[i].y + 1) * MAP_WIDTH] != 0xffff && ghosts[i].dy != -1) {
                        available_moves[num_available_moves][0] = 0;
                        available_moves[num_available_moves][1] = 1;
                        num_available_moves++;
                    }

                    if(ghost_path[ghosts[i].x + (ghosts[i].y - 1) * MAP_WIDTH] != 0xffff && ghosts[i].dy != 1) {
                        available_moves[num_available_moves][0] = 0;
                        available_moves[num_available_moves][1] = -1;
                        num_available_moves++;
                    }
                }
            }
        }

        if (distance <= 80) {
            if (ghosts[i].edible) {
                // Find the farthest available move from the player
                int farthest_move_index = -1;
                int farthest_move_distance = -1;

                for (int j = 0; j < num_available_moves; j++) {
                    int move_x = available_moves[j][0];
                    int move_y = available_moves[j][1];

                    int new_x = ghosts[i].x + move_x;
                    int new_y = ghosts[i].y + move_y;

                    int move_distance = abs(new_x - player1.x) + abs(new_y - player1.y);

                    if (move_distance > farthest_move_distance) {
                        farthest_move_index = j;
                        farthest_move_distance = move_distance;
                    }
                }

                // Change dx and dy to the farthest available move
                if (farthest_move_index != -1) {
                    int move_x = available_moves[farthest_move_index][0];
                    int move_y = available_moves[farthest_move_index][1];

                    ghosts[i].dx = move_x;
                    ghosts[i].dy = move_y;
                }
                
            } else {
                // Find the closest available move to the player
                int closest_move_index = -1;
                int closest_move_distance = 99999;

                for (int j = 0; j < num_available_moves; j++) {
                    int move_x = available_moves[j][0];
                    int move_y = available_moves[j][1];

                    int new_x = ghosts[i].x + move_x;
                    int new_y = ghosts[i].y + move_y;

                    int move_distance = abs(new_x - player1.x) + abs(new_y - player1.y);

                    if (move_distance < closest_move_distance) {
                        closest_move_index = j;
                        closest_move_distance = move_distance;
                    }
                }

                // Change dx and dy to the closest available move
                if (closest_move_index != -1) {
                    int move_x = available_moves[closest_move_index][0];
                    int move_y = available_moves[closest_move_index][1];

                    ghosts[i].dx = move_x;
                    ghosts[i].dy = move_y;
                }
            }
        }

        else {
            // Change dx and dy randomly to one of the available moves
            if (num_available_moves > 0) {
                int random_move_index = rand() % num_available_moves;
                int move_x = available_moves[random_move_index][0];
                int move_y = available_moves[random_move_index][1];

                ghosts[i].dx = move_x;
                ghosts[i].dy = move_y;
            }
        }
    }
}


void update_ghosts() {
  for (int i = 0; i < 4; i++) {
    if(ghosts[i].timer == 0 && ghosts[i].jail){
        ghosts[i].jail = false;
        ghosts[i].x = 203;
        ghosts[i].y = 103;
    }

    if (ghosts[i].jail) {
      ghosts[i].timer--;
      continue;
    }

    if(ghosts[i].dx == 1){
        ghosts[i].sprite[0] = ghost_L1;
        ghosts[i].sprite[1] = ghost_L2;
    }
    else if (ghosts[i].dx == -1){
        ghosts[i].sprite[0] = ghost_R1;
        ghosts[i].sprite[1] = ghost_R2;
    }
    else if (ghosts[i].dy == 1){
        ghosts[i].sprite[0] = ghost_D1;
        ghosts[i].sprite[1] = ghost_D2;
    }
    else if (ghosts[i].dy == -1){
        ghosts[i].sprite[0] = ghost_U1;
        ghosts[i].sprite[1] = ghost_U2;
    }

    ghosts[i].x_prev = ghosts[i].x;
    ghosts[i].y_prev = ghosts[i].y;

    ghosts[i].x += ghosts[i].dx;
    ghosts[i].y += ghosts[i].dy;

    if(ghosts[i].x == 98){
        ghosts[i].x = MAP_WIDTH;
    }
    else if (ghosts[i].x == MAP_WIDTH){
        ghosts[i].x = 90;
    }
  }
}

